import React from 'react';
import Footer from '../Footer/Footer';
import NavBar from '../Navbar/NavBar';
import { TextField } from '@mui/material';
import { makeStyles, multiTextField } from '@mui/styles';
import './SignUp.css'
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { purple } from '@mui/material/colors';
import Button from '@mui/material/Button';

const theme = createTheme({
    palette: {
        primary: {
            // Purple and green play nicely together.
            main: purple[500],
        },
        secondary: {
            // This is yellow as hex.
            main: '#F9B70B',
        },
    },
});


const useStyles = makeStyles({
    field: {
        marginBottom: '20px'
    }
})


function SignUp() {

    const classes = useStyles()



   return(
       <>
           <NavBar/>
           <div className="signup">

               <div className="signupHeader">
                   <div className="backarrow">
                       <img src="https://res.cloudinary.com/do5wu6ikf/image/upload/v1684452441/starpenzu/back_qpybto.svg" alt=""/>
                   </div>

                   <div className="signupTitle">
                       Register
                   </div>
               </div>
               <form action="" className="register">
                   <TextField
                       className={classes.field}
                       id="outlined-basic"
                       label="First Name"
                       variant="outlined"
                       type='text'
                   />
                   <TextField  className={classes.field} id="outlined-basic" label="Outlined" variant="outlined" />
                   <TextField className={classes.field} id="outlined-basic" label="Outlined" variant="outlined" />
                   <TextField className={classes.field} id="outlined-basic" label="Outlined" variant="outlined" />
               </form>


           </div>

           <Footer/>
       </>

   )
}

export default SignUp;
